import { FaExclamationTriangle } from 'react-icons/fa'

const Error = () => {
    return (
        <IconContext.Provider value={{color: 'red', className: 'error'}}>
            <div>
                <FaExclamationTriangle />
            </div>
        </IconContext.Provider>
    );
}

export default Error;
